import React from "react";

function SideHeader() {
  return (
    <div>
      <div style={{ textAlign: "center", color: "#474444", fontWeight: "600" }}>
        <p style={{marginTop:"5vh",fontSize:"2em"}}>QUIZZIE</p>
        <p style={{marginTop:"25vh",fontSize:"1.4em"}}>Dashboard</p>
        <p style={{marginTop:"5vh",fontSize:"1.4em"}}>Analytics</p>
        <p style={{marginTop:"5vh",fontSize:"1.4em"}}>Create Quiz</p>
        <p style={{marginTop:"30vh",fontSize:"1.6em",marginBottom:"2vh"}}>Logout</p>
      </div>
    </div>
  );
}

export default SideHeader;
